  [],\n\t\"num_tags\": 0,\n\t\"name\": \"sbi-aws02-i-bottle-and-nutrient-data-collected-from-the-polar-star-in-the-beaufort-and-chukchi-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The field phase of the Shelf-Basin Interactions
  Experiment (SBI) began in 2002 with a series of three cruises to the Chukchi and
  Beaufort Seas. SBI is a multi-institutional program investigating how the western
  Arctic shelves communicate with the interior of the Canada Basin, from a coupled
  physical/biochemical perspective. The physical oceanographic (PO) component of SBI
  was carriednout on the Coast Guard icebreaker Polar Star, from mid-July to mid-August.
  The primary aim of the PO component is to identify and understand the water masses
  and mechanisms by which shelf waters ventilate the western Arctic halocline.nnThe
  major goals of the 2002 Arctic West Summer cruise (AWS02) were to (1) deploy a system
  of moorings that will measure the outflow from the Chukchi shelf (the UW/UAF component);
  (2) deploy a high-resolution moored array across the Beaufort slope, downstream
  of the outflows, to determine how these waters are fluxed into the interior (the
  WHOI component); and (3) conduct a hydrographic survey encompassing locations along
  the Chukchi and Beaufort shelf edge. The cruisenwas a resounding success on all
  accounts.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
